import React, { Component } from "react";
import firebase from "../../firebase";

class DemographicsForm extends Component {

    state = {
        grade: "",
        school: "",
        gender: "",
        ethnicity: "",
        onCampus: "", 
        ipAddress: "",
    };

    handleSelectGrade = event => {
        this.setState({grade: event.target.value});
    }

    handleSelectSchool= event => {
        this.setState({school: event.target.value});
    }

    handleSelectGender= event => {
        this.setState({gender: event.target.value});
    }

    handleSelectEthnicity= event => {
        this.setState({ethnicity: event.target.value});
    }

    handleSelectOnCampus= event => {
        this.setState({onCampus: event.target.value});
    }

    render() {
        return (
            <form>
                <label>Grade:</label>
                <div>
                    <select class="custom-select" value={this.state.grade} onChange={this.handleSelectGrade}>
                        <option value="1">Freshman</option>
                        <option value="2">Sophomore</option>
                        <option value="3">Junior</option>
                        <option value="4">Senior</option>
                    </select>
                </div>
                <br></br>

                <label>School:</label>
                <div>
                    <select class="custom-select" value={this.state.school} onChange={this.handleSelectSchool}>
                        <option value="1">SEAS</option>
                        <option value="2">The College</option>
                        <option value="3">Wharton</option>
                        <option value="4">Nursing</option>
                    </select>
                </div>
                <br></br>

                <label>Gender:</label>
                <div>
                    <select class="custom-select" value={this.state.gender} onChange={this.handleSelectGender}>
                        <option value="1">Female</option>
                        <option value="2">Male</option>
                        <option value="3">Other</option>
                    </select>
                </div>
                <br></br>

                <label>Ethnicity:</label>
                <div>
                    <select class="custom-select" value={this.state.ethnicity} onChange={this.handleSelectEthnicity}>
                        <option value="1">American Indian or Alaska Native</option>
                        <option value="2">Asian</option>
                        <option value="3">African American</option>
                        <option value="4">Native Hawaiian or Other Pacific Islander</option>
                        <option value="5">White</option>
                    </select>
                </div>
                <br></br>

                <label>Location:</label>
                <div>
                    <select class="custom-select" value={this.state.ethnicity} onChange={this.handleSelectEthnicity}>
                        <option value="1">American Indian or Alaska Native</option>
                        <option value="2">Asian</option>
                        <option value="3">African American</option>
                        <option value="4">Native Hawaiian or Other Pacific Islander</option>
                        <option value="5">White</option>
                    </select>
                </div>

            </form>
        );
    }
}

export default DemographicsForm;
